import React from "react";
function Calculator() {
  // const addition = () => {};
  // const substraction = () => {};
  // const multiplication = () => {};
  // const division = () => {};
  return (
    <>
      <table className="table-auto">
        <th>
          <td>AC</td>
          <td>+/-</td>
          <td>%</td>
          <td>/</td>
        </th>

        <tr>
          <td>7</td>
          <td>8</td>
          <td>9</td>
          <td>x</td>
        </tr>
        <tr>
          <td>4</td>
          <td>5</td>
          <td>6</td>
          <td>-</td>
        </tr>
        <tr>
          <td>1</td>
          <td>2</td>
          <td>3</td>
          <td>+</td>
        </tr>
        <tr>
          <td colSpan={2}>0</td>
          <td>.</td>
          <td>=</td>
        </tr>
      </table>
    </>
  );
}
export default Calculator;
